import { useState } from "react";
import BlogList from "./BlogList";

const Home = () => {

    const [blogs, setBlogs] = useState([
        {title: "My new Website", body: "lorem ipsum ...", author: "tom", id: 1},
        {title: "Welcome Party!", body: "lorem ipsum ...", author: "brad", id: 2},
        {title: "Web dev top tips", body: "lorem ipsum ...", author: "rambo", id: 3}
    ]);

    return ( 
        <div className="home">
            <BlogList blogs={blogs} title="All Blogs!"/>
            <BlogList blogs={blogs.filter(blog => blog.author === "rambo")} title="Rambo's Blogs"/>
        </div>
     );
}

export default Home;
